		ELSEIF (OLD.`name` <> NEW.`name`) THEN
			VALUES ('judges', 'name', CAST(NEW.`id` AS UNSIGNED),  'UPDATE', OLD.`name`, NEW.`name`);
		ELSEIF (OLD.`patronymic` <> NEW.`patronymic`) THEN
			VALUES ('judges', 'patronymic', CAST(NEW.`id` AS UNSIGNED),  'UPDATE', OLD.`patronymic`, NEW.`patronymic`);
		ELSEIF (OLD.`photo` <> NEW.`photo`) THEN
			VALUES ('judges', 'photo', CAST(NEW.`id` AS UNSIGNED),  'UPDATE', OLD.`photo`, NEW.`photo`);
		ELSEIF (OLD.`status` <> NEW.`status`) THEN
			VALUES ('judges', 'status', CAST(NEW.`id` AS UNSIGNED),  'UPDATE', CAST(OLD.`status` AS CHAR), CAST(NEW.`status` AS CHAR));
		ELSEIF (OLD.`phone` <> NEW.`phone`) THEN
			VALUES ('judges', 'phone', CAST(NEW.`id` AS UNSIGNED),  'UPDATE', OLD.`phone`, NEW.`phone`);					
		END IF;
	END
$$
